export default function BottomAxis(){
    const ref = useRef();
    
    useEffect(()=>{
        const xScale = scaleLinear()
            .domain( [0,100] )
            .range( [10, 290] )
    
        const svgElement = select(
            ref.current
        );
    
        const axisGenerator = axisBottom(
            xScale 
        );
    
        svgElement.append("g")
            .call( axisGenerator )
    }, []);
    
    return(
        <svg ref={ref}></svg>
    )
}
